char BUF1[0x28c8];

int compute_buf_val(char *buf, int shift, int offset)
{
  int val;

  val = shift;
  if (shift < 0) {
    val = shift + 7;
  }
  return (int)*(char *)(buf + ((val >> 3) + offset * 0x12)) >>
         (7U - (char)(shift % 8) & 0x1f) & 1;
}

int compute_buf_val_secret(char *buf, int offset_1_base, int offset_2_base, char *key)
{
  char res;
  int counter;
  int i;

  counter = 0;
  do {
    if (key[1] <= counter) {
      return 1;
    }
    for (i = 0; i < *key; i = i + 1) {
      res = compute_buf_val(buf, offset_1_base + i, offset_2_base + counter);
      if (res != *(char *)((long)(i + *key * counter) + *(long *)(key + 2))) {
        return 0;
      }
    }
    counter = counter + 1;
  } while( 1 );
}

void mangle(char *buf, int offset_1, int offset_2, char bit)
{
  int a;
  char b;

  a = offset_1;
  if (offset_1 < 0) {
    a = offset_1 + 7;
  }
  a = a >> 3;
  b = (char)(offset_1 % 8);
  if (bit == '\0') {
    *(char *)(buf + (a + offset_2 * 0x12)) =
         *(char *)(buf + (a + offset_2 * 0x12)) & ~(char)(1 << (7U - b & 0x1f));
  }
  else {
    *(char *)(buf + (a + offset_2 * 0x12)) =
         *(char *)(buf + (a + offset_2 * 0x12)) | (char)(1 << (7U - b & 0x1f));
  }
  return;
}

int getconstant()
{
  char init_buf_val;
  char buf_val;
  char val;
  int ret;
  int count;
  int i;
  int j;
  int k;

  ret = 1;
  memcpy(BUF1, BUF0, 0x28c8);
  count = 1;
  do {
    if (0x242 < count) {
      memcpy(BUF0, BUF1, 0x28c8);
      return ret;
    }
    for (i = 1; i < 0x8f; i = i + 1) {
      init_buf_val = compute_buf_val(BUF0, i, count);
      val = '\0';
      for (j = -1; j < 2; j = j + 1) {
        for (k = -1; k < 2; k = k + 1) {
          if ((k != 0) || (j != 0)) {
            buf_val = compute_buf_val(BUF0, k + i, count + j);
            val = val + buf_val;
          }
        }
      }
      if (init_buf_val == '\0') {
        if (val == '\x03') {
          if ((((i == 1) || (count == 1)) || (i == 0x8e)) || (count == 0x242)) {
            puts("Unexpected emergency... ordering the squadron to fall back at once");
                    /* WARNING: Subroutine does not return */
            exit(1);
          }
          mangle(BUF1, i, count,1);
          ret = 0;
        }
      }
      else if ((val < '\x02') || ('\x03' < val)) {
        mangle(BUF1, i, count,0);
        ret = 0;
      }
    }
    count = count + 1;
  } while( 1 );
}


void populate (char *dst_buf, int offset_1_base, int offset_2_base, char *key)
{
  int i;
  int j;
  
  for (i = 0; i < key[1]; i = i + 1) {
    for (j = 0; j < *key; j = j + 1) {
      mangle(dst_buf, offset_1_base + j, offset_2_base + i,
             (int)*(char *)((long)(j + *key * i) + *(long *)(key + 2)));
    }
  }
  return;
}


int check(int passwd)
{
  int res;
  int ret;
  char c;
  int i;
  int j;
  int k;
  
  for (i = 0; i < 0x20; i = i + 1) {
    if ((passwd >> (0x1fU - (char)i & 0x1f) & 1) != 0) {
      populate(BUF0, 100, i * 0xe + 10, KEY0);
    }
  }
  c = getconstant();
  if (c == '\0') {
    ret = 0;
  }
  else {
    for (k = 0; k < 0x20; k = k + 1) {
      res = compute_buf_val_secret(BUF0, 0x7d, k * 0xe + 5, KEY1);
      if (res == 0) {
        return 0;
      }
    }
    ret = 1;
  }
  return ret;
}

